class Solution {

    /**
     * @param Integer[] $nums
     * @return Boolean
     */
    function isGood($nums) {
        $maxNum = max($nums);
        $countValues = array_count_values($nums);

        // Check if the array length matches the expected length
        if (count($nums) !== $maxNum + 1) {
            return false;
        }

        // Check if each number from 1 to maxNum - 1 appears exactly once
        // and maxNum appears exactly twice
        for ($i = 1; $i <= $maxNum; $i++) {
            if (!isset($countValues[$i]) || $countValues[$i] !== ($i == $maxNum ? 2 : 1)) {
                return false;
            }
        }

        return true;
    }
}
